import { Link as LinkR } from 'react-router-dom';
import styled from 'styled-components';

export const LBtn = styled.nav`
  display: flex;
  align-items: center;

  @media screen and (max-width: 760px) {
    display: none;
  }
`;

export const LBtnLink = styled(LinkR)`
  padding: 25px 25px;
  height: 80px;
  color: #fff;
  font-size: 16px;
  outline: none;
  border: none;
  cursor: pointer;
  transition: all 0.2s ease-in-out;
  text-decoration: none;

  &:hover {
    transition: all 0.2s ease-in-out;
    color: #010606;
    background: #e6f2f6;
  }
`
